css:
#grand {
    width:80%;
    height:80%;
    object-fit: contain;
    display: inline-block;
}

.box {
    display: flex;
    width:100%;
}
.mini {
    width:calc(100% / 4);
    height:160px;
    object-fit: cover;
}
#lightbox {
    position:fixed;
    top:0;
    left:0;
    width:100%;
    height:100%;
    background-color:rgba(0,0,0,0.9);
    padding:10% 10%;
    display:none;
}

#lightbox.montrer {
    display:block;
}

